script: |
  super -f text -I q9809.spq | sort > q9809.out

inputs:
  - name: q9809.spq
    data: |
      SELECT DISTINCT COUNT ( * ), + ( - + COUNT ( * ) ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q9809.out
    data: |
      9	-9
